        exponentLookup: function (c) {
          return 0.9 < (Math.log(c) / Math.log(10)) % 1
            ? Math.ceil(Math.log(c) / Math.log(10))
            : Math.floor(Math.log(c) / Math.log(10))
        },
        cookiesAnnotation: function (c) {
          var d = [' ', 'K', 'M', 'B', 'T']
          if (0 > c) return d[0]
          order = Math.floor(c / 3)
          if (5 > order) return d[order]
          startLeft = 65
          startRight = 97
          leftChar = startLeft + (order - 5) / 26
          rightChar = startRight + ((order - 5) % 26)
          return String.fromCharCode(leftChar) + String.fromCharCode(rightChar)
        },
